import { Component } from '@angular/core';
import { ActivatedRoute } from '@angular/router';
import { UserServiceService } from 'src/app/services/user-service.service';

@Component({
  selector: 'app-rental-agreement',
  templateUrl: './rental-agreement.component.html',
  styleUrls: ['./rental-agreement.component.css']
})
export class RentalAgreementComponent {
  carId:any;
  rentalDuration:any
  userId:any
  constructor(private router:ActivatedRoute,private userService:UserServiceService){
    this.userId=this.userService.getIdFromToken();
    console.log(this.userId);

}
}
  ngoninit(){
    this.router.params.subscribe(params=>{
      console.log(params);
      this.carId=params['carId'];
      this.rentalDuration=params['rentalDuration'];
      console.log(this.carId);
      console.log(this.rentalDuration);
  })

  });


